import Head from "next/head";

class Layout extends React.Component {
  render() {
    return (
      <div>
        <Head>
          <title>My page title</title>
          <meta
            name="viewport"
            content="initial-scale=1.0, width=device-width"
          />
        </Head>
        <span />
        <span />
        <span />
        <span />
        <span />
        <span />
        <span />
        <p>THis is layoutttttttt</p>
        {this.props.children}
      </div>
    );
  }
}

export default Layout;
